Max.Current: 10A;
Max.Power Rating: 1250W;
Surge Protector Rating: 900 Joules;
USB Port Output: DC 5V, Total 4.2A;
Cord Length: 5 Ft;
Color: White;
Item Dimensions: 4.04*4.29*1.65 in;

Package list:
1 x Surge Protector Power Strip with usb Port.
1 x Instruction manual.
1 x Paper Box.

Notice:
Do not exceed the total rating or it may cause damage to the unit and fire hazards.
NOTE: The UCB-C port doesn't support any other devices which need 14~22V charging voltage.

